import axios from 'axios';
class Testtable extends Component {
  constructor(props) {
    super(props);
    this.state = { 
      data:[{'test1' : "v1" , "test2" : 'v2' , "test3" : 'v3'},{'test1' : "e1" , "test2" : 'e2' , "test3" : 'e3'}],
      headers: ['test1','test2','test3']
      // deleteurl='',
     }
  }
  render() {
    return (  
      // <div> 
        <table>
          <thead>
          {
            this.state.headers.map(
(item,pos)=>
            {
              <th>{item}</th>         
            }
            )
          }
          </thead>
          <tbody>
            {
              this.state.data.map(item=>{<tr>
                {this.state.headers.map(ele=>{
                 return(<td>{item[ele]}</td>)   
                })}
              </tr>})
            }
          </tbody>
        </table>
      // </div>

    );
  }
}
 
export default Testtable;
